import styled from 'styled-components'

const AdminLog = styled.div`
    display: flex;
    background-color: white;
    margin-top: 5rem;
    align-self: center;
    align-content: center;
    width: 20rem;
    border-radius: 2rem;
    height:40rem;
    padding: 2rem;
    display: inline-block;
    border-style: solid;
    border-color: #00a2ff;
`
const ColoredLine = styled.hr`
            color:#00a2ff;
            background-color: #00a2ff;
            height: 1px;
            display: flex;
            width: 16rem;
            align-self: center;
            margin-top: 0.5rem;
            margin-right: 3rem;

`

const Admin= ()=>{
    return(
        <AdminLog> 
             <h1>Login As Admin</h1>
             <ColoredLine/>
        </AdminLog>

    )
}
export default Admin
